üåø Dalam Rangka Memperingati "Hari Bersih-bersih Sedunia" atau "World Cleanup Day" Tingkat Kota Bekasi Tahun 2025, pada hari Sabtu, 20 September 2025 Kelurahan Kranji bersama dengan OPD (Organisasi Perangkat Daerah) lainnya di lingkup Pemerintah Kota Bekasi turut berpartisipasi dalam Gerakan Bersih-bersih Massal di Sepanjang Jalan I Gusti Ngurah Rai.

Aksi bersih-bersih ini adalah momentum untuk mengajak masyarakat untuk turut membersihkan maupun menjaga kebersihan bumi dan menunjukan kepedulian kita terhadap lingkungan sekitar sekaligus menimbulkan kesadaran bahwa menjaga lingkungan adalah tanggung jawab bersama.

ü§ù Mari kita rawat bumi dari permasalahan sampah dan Mari bersama-sama kita dukung Kegiatan World Cleanup Day demi Kota Bekasi yang lebih bersih, asri dan sehat.

